Jangan sebar kandungan yang melanggar peraturan permainan. Pelanggar boleh dikenakan tindakan beat. 
Kandungan pelanggaran termasuk tetapi tidak terhad kepada:
1. Maklumat privasi peripadi seperti kata lauan akaun, nama sebenar dan sebagainya. 
2. Maklumat yang mendorong seperti pembelian cas semula, muat turun pautan dan sebagainya.
3. Maklumat sosial seperti platform sosial, maklumat perhubungan, pautan tapak web dan sebagainya.
4. Kandungan yang melanggar undang-undang dan peraturan negara:
 (1) Melanggar prinsip Perlembagaan;
 (2) Membahayakan keselamatan negara, membocorkan rahsia negara, menumbangkan kuasa negara dan meruntuhkan perpaduan negara; 
 (3) Merosakkan kehormatan dan kepentingan negara; 
 (4) Menghasut kebencian etnik, diskriminasi etnik dan menjejaskan pepaduan etnik;
 (5) Menggugat agama negara dan mempromosikan khurafay feudal;
 (6) Menyebarkan khabar angin, mengganggu ketenteraan sosial dan menjejaskan kestabilan sosial;
 (7) Menyebarkan kelucahan, pronografi, perjudian, keganasan atau penghasut jenayah; 
 (8) menghina atau memfitnah orang lain, melanggar undang-undang dan hak kepentingan orang lain; 
 (9) Menghasut perhimpunan haram, persatuan, perarakan, demonstrasi, mengumpul orang ramai untuk mengganggu keteteraan sosial；
 (10) Bertindak atas nama organisasi sivil haram;
 (11) Mereka yang tidak mematuhi ""Peruntukan Interim mengenai Pembangunan dan Pengurusan Perkhidmatan Maklumat Awam untuk Alat Pemesejan Segera"" dan mematuhi ""tujuh garis bawah"" keperluan undang-undang dan peraturan, sistem sosialis, kepentingan negara, kepentingan undang-undang warganegara, ketenteraman awam, moral sosial dan kesahihan maklumat, dsb. ；
 (12) Mengandungi kandungan lain yang dilarang oleh undang-undang dan peraturan pentadbiran.
5. Kandungan lain yang tidak mematuhi undang-undang, peraturan dan keperluan platform"

