#cfa7a0f Mengenai Fungsi Pengurusan Muzik #N
- Permainan dalam talian, hanya tuan rumah atau pelayan mempunyai kuasa untuk menjalankan operasi pengurusan dalam pemain muzik, seperti jeda, lagu seterusnya, hapus lagu, dan sebagainya;

#cfa7a0f Mengenai kandungan muzik yang boleh dimainkan pada permintaan #n
-Untuk masa itu, hanya beberapa lagu yang diberi kuasa oleh muzik QQ disokong. Pada masa ini, kami berusaha untuk mendapatkan lebih banyak keizinan lagu-atas permintaan, jadi tunggu;

#cfa7a0f Mengenai Sekatan On-Demend dalam Mod Dalam Talian #N
-Music sudah dalam senarai yang dimainkan tidak boleh ditambah berulang kali atas permintaan;
-Non-pemilik rumah hanya boleh menambah tiga lagu ke senarai menunggu pada masa yang sama. Selepas mencapai had atas, mereka perlu menunggu lagu-lagu yang telah diperintahkan untuk menyelesaikan atau dipadamkan oleh pemilik rumah sebelum mereka boleh memerintahkan semula mereka;

#cfa7a0f tentang mod main balik muzik #n
-Queue Play: Mainkan dalam urutan giliran main, dan lagu itu akan dikeluarkan dari barisan selepas ia dimainkan.
-Loop bermain: bermain dalam urutan giliran bermain, dan lagu itu akan kekal dalam senarai menunggu selepas bermain.

#cfa7a0f tentang fungsi main balik penuh #n
- Apabila ia dihidupkan, semua pemain dalam permainan boleh menambah lagu ke giliran main.
-When ditutup, hanya tuan rumah atau pelayan dalam permainan boleh menambah lagu ke giliran main.

1. Pengembara mempunyai peluang untuk mencetuskan pek hadiah kejutan apabila mereka melengkapkan pelbagai tindakan permainan;
2. Setiap pek hadiah acara yang dicetuskan hanya boleh dibeli sekali, dan pek hadiah hilang selepas pembelian selesai;
3. Setiap pek hadiah kejutan mempunyai pemasa undur yang berasingan. Selepas undur, pek hadiah hilang. Jangan ketinggalan, setiap petualang!

"Butang kiri dipilih: apabila elemen induk berubah, jarak antara elemen anak dan sempadan kiri elemen induk tidak berubah;
-Butang di sebelah kanan dipilih: apabila elemen induk berubah, jarak antara elemen anak dan sempadan kanan elemen induk tidak berubah;
-Butang atas dipilih: apabila elemen induk berubah, jarak antara elemen anak dan sempadan atas elemen induk tidak berubah;
-Butang bawah dipilih: apabila elemen induk berubah, jarak antara elemen anak dan sempadan bawah elemen induk tidak berubah;
-Butang kiri dan kanan dipilih pada masa yang sama: apabila elemen induk berubah, jarak mendatar antara elemen anak dan titik tengah elemen induk tidak berubah;
-Butang atas dan bawah dipilih pada masa yang sama: apabila elemen induk berubah, jarak menegak antara elemen anak dan titik tengah elemen induk tidak berubah;
